package com.ilad;

public class Calculator {

	public Object substract(int i, int j) {
		return i-j;
	}

	public Object add(int i, int j) {
		// TODO Auto-generated method stub
		return i+j;
	}

	public Object multiply(int i, int j) {
		// TODO Auto-generated method stub
		return i*j;
	}

	public Object divide(int i, int j) {
		// TODO Auto-generated method stub
		return i/j;
	}

}
